/****** SYSTEM REQUIREMENTS *****/
/****** SYSTEM REQUIREMENT 1 *****/
	/* read info about tag which is closed to rfid. */
/****** END SYSTEM REQUIREMENTS *****/

/****** DEFINITION OF LIBRARIES *****/
#include <SPI.h>
#include <MFRC522.h>  //https://github.com/miguelbalboa/rfid

/****** FUNCTION PROTOTYPES *****/
void setup(void);
void loop(void);
void updateOutputs(void);

/***** DEFINITION OF DIGITAL INPUT PINS *****/
const uint8_t rfid_MFRC522_IRQ_PIN_D5 = 5;

/***** DEFINITION OF DIGITAL OUTPUT PINS *****/
const uint8_t rfid_MFRC522_RST_PIN_D4 = 4;

/***** DEFINITION OF SPI PINS *****/
const uint8_t rfid_MFRC522_SPI_PIN_MOSI_D51 = 51;
const uint8_t rfid_MFRC522_SPI_PIN_MISO_D50 = 50;
const uint8_t rfid_MFRC522_SPI_PIN_SCLK_D52 = 52;
const uint8_t rfid_MFRC522_SPI_PIN_CS_D53 = 53;

/***** DEFINITION OF OUTPUT RAW VARIABLES *****/
/***** used to store raw data *****/
bool rfid_MFRC522_RST_PIN_D4_rawData = 0;

/***** DEFINITION OF OUTPUT PHYSICAL VARIABLES *****/
/***** used to store data after characteristic curve transformation *****/
float rfid_MFRC522_RST_PIN_D4_phyData = 0.0;

/****** DEFINITION OF LIBRARIES CLASS INSTANCES*****/
MFRC522 mfrc522(rfid_MFRC522_SPI_PIN_CS_D53, rfid_MFRC522_RST_PIN_D4);  // Create MFRC522 instance

void setup(void) {
  // Initialize serial communications with the PC
  Serial.begin(9600);
  while (!Serial);  // Do nothing if no serial port is opened (added for Arduinos based on ATMEGA32U4)

  // Initialize the SPI library
  SPI.begin();

  // Initialize the MFRC522
  mfrc522.PCD_Init();
  mfrc522.PCD_DumpVersionToSerial();  // Show details of PCD - MFRC522 Card Reader details

  // Print a message indicating readiness to scan RFID tags or cards
  Serial.println(F("Scan PICC to see UID, SAK, type, and data blocks..."));

  // Setup pin modes
  pinMode(rfid_MFRC522_IRQ_PIN_D5, INPUT_PULLUP);
  pinMode(rfid_MFRC522_RST_PIN_D4, OUTPUT);
  pinMode(rfid_MFRC522_SPI_PIN_CS_D53, OUTPUT);
}

void loop(void) {
  // Refresh output data
  updateOutputs();

  // Check for new cards
  if (!mfrc522.PICC_IsNewCardPresent()) {
    return;
  }

  // Select one of the cards
  if (!mfrc522.PICC_ReadCardSerial()) {
    return;
  }

  // Dump debug info about the card; PICC_HaltA() is automatically called
  mfrc522.PICC_DumpToSerial(&(mfrc522.uid));
}

void updateOutputs() {
  // Update the raw data to the physical pin
  digitalWrite(rfid_MFRC522_RST_PIN_D4, rfid_MFRC522_RST_PIN_D4_rawData);
}

/* END CODE */

 @Override
    public void onTransactionResult(int i, Intent intent) throws Exception {
        Log.e(TAG,"onTransactionResult");
        mOnSwipeListerCallback.onDisplayMsg("onTransactionResult");
        try {
            byte[] script = ServiceManager.getInstence().getPboc().getScriptResult();
            Log.e("script", script.toString());

            Log.e("onTransResult", ""+script.toString());
            //Issuer Script Results
            //Byte 1 	   Script Result  		Most significant nibble: Result of the Issuer Script
            //											   	 		processing performed by the terminal:
            //											    		'0' = Script not performed
            //															'1' = Script processing failed
            //															'2' = Script processing successful
            //															Least significant nibble: Sequence number of the Script Command
            //															'0' = Not specified
            //															'1' to 'E' = Sequence number from 1 to 14
            //															'F' = Sequence number of 15 or above
            //
            //Bytes 2-5 Script Identifier    Script Identifier of the Issuer Script received by the
            //															 terminal, if available, zero filled if not. Mandatory if
            //															 more than one Issuer Script was received by the terminal.
        } catch (Exception e) {
            Log.e("EXCEPTION", e.getMessage());
            e.printStackTrace();
        }

        OutputPBOCAAData out = new OutputPBOCAAData(intent);
        LogUtil.se(getClass(),"PBOC 55 field:" + out.get55Field());
        LogUtil.se(getClass(),"PBOC AA result:" + out.getAAResult());
        LogUtil.se(getClass(),"PBOC Card seq number:" + out.getCardSeqNum());
        LogUtil.se(getClass(),"PBOC IC data:" + out.getICData());
        LogUtil.se(getClass(),"PBOC reversal data:" + out.getReversalData());
        LogUtil.se(getClass(),"PBOC TC:" + out.getTCData());

        final int[] L_55TAGS = new int[]{
                0x5F2A,0x5F34,0x82,0x84,  0x95,  0x9A,  0x9C,0x9F02,0x9F09,0x9F10,0x9F1A,0x9F1E,
                0x9F26,0x9F27,0x9F33,0x9F34,0x9F35,0x9F36,0x9F37,0x9F41,0x9F53,0x9F03,0x9F4E,0x9F39,0x57};
        String temp55;
        try {
            temp55 = ServiceManager.getInstence().getPboc().getF55Filed(L_55TAGS);
            LogUtil.se(getClass(),"temp55ResultÔºö" + temp55);
        }catch (Exception e){
            e.printStackTrace();
        }


        if (i == PBOCTransactionResult.QPBOC_ARQC) {

            // quick pay to process(Âø´ÈÄü‰∫§ÊòìÊµÅÁ®ã)
            OutputQPBOCResult rf_data = new OutputQPBOCResult(intent);
            KernelDataRecord mDataRecord = new KernelDataRecord();
            mDataRecord.setPiccDataRecord(rf_data.getKernelData(), null);

            LogUtil.se(getClass(),"rf_data.get55Field():"+rf_data.get55Field());
            LogUtil.se(getClass(),"rf_data.getCardSN():"+rf_data.getCardSN());
            LogUtil.se(getClass(),"rf_data.getDate():"+rf_data.getDate());
            LogUtil.se(getClass(),"rf_data.getExpiredDate():"+rf_data.getExpiredDate());
            LogUtil.se(getClass(),"rf_data.getICData():"+rf_data.getICData());
            LogUtil.se(getClass(),"rf_data.getPAN():"+rf_data.getPAN());
            LogUtil.se(getClass(),"rf_data.getCvmCode():"+rf_data.getCvmCode());
            LogUtil.se(getClass(),"rf_data.getKernelData():"+rf_data.getKernelData());


            byte[] tempArray = ServiceManager.getInstence().getPboc().getEmvTlvData(0x5F2A);
            String tenmpString = BCDHelper.bcdToString(tempArray, 0, tempArray.length);
            JSONObject jsonObject = new JSONObject();
            jsonObject.put("5F02",tenmpString);
            Log.e(TAG,"5F02:"+tenmpString);

            tempArray = ServiceManager.getInstence().getPboc().getEmvTlvData(0x57);
            tenmpString = BCDHelper.bcdToString(tempArray, 0, tempArray.length);
            jsonObject.put("57",tenmpString);
            Log.e(TAG,"57:"+tenmpString);

            tempArray = ServiceManager.getInstence().getPboc().getEmvTlvData(0x95);
            tenmpString = BCDHelper.bcdToString(tempArray, 0, tempArray.length);
            jsonObject.put("95",tenmpString);
            Log.e(TAG,"95:"+tenmpString);

            String temp = jsonObject.toString();
            Log.e(TAG,"temp:"+temp);



            byte cvmCode = rf_data.getCvmCode();
            switch (cvmCode) {
                case OutcomeParameterSet.CONTACTLESS_OPS_CVM_NO_CVM:
                case OutcomeParameterSet.CONTACTLESS_OPS_CVM_SIGNATURE:
                case OutcomeParameterSet.CONTACTLESS_OPS_CVM_CONFIRMATION_CODE_VERIFIED:
                    //online_transaction.sendMessage(online_transaction.obtainMessage(ONLINE_PROCESS_COMMU));
                    break;
                case OutcomeParameterSet.CONTACTLESS_OPS_CVM_ONLINE_PIN:
                    //pinpad_model.sendEmptyMessage(PIN_DIALOG_SHOW);
                    break;
                default:
                    break;
            }

        } else if (i == PBOCTransactionResult.APPROVED) {
            LogUtil.se(getClass(),"Transaction APPROVED");
            Log.e("TRABS", "Transaction APPROVED");
        }else if (i == PBOCTransactionResult.FINISH) {
            LogUtil.se(getClass(),"Rupay Transaction success");
        } else if (i == PBOCTransactionResult.TERMINATED || i == PBOCTransactionResult.DECLINED) {
            // transaction the fail as well as stopping the
            // transaction(‰∫§ÊòìÂ§±Ë¥•Âπ∂‰∏îÂÅúÊ≠¢‰∫§Êòì)
            LogUtil.se(getClass(),"PBOC Transaction fail");
            Log.e("TRANS", "PBOC Transaction fail");
            if(cardtype == CardType.IC_CARD) {
                try {
                    int code = intent.getIntExtra("code", 0);
                    int lastErrorCode = ServiceManager.getInstence().getPboc().getLastErrorCode();
                    LogUtil.se(getClass(), "code:" + code);
                    LogUtil.se(getClass(), "lastErrorCode:" + lastErrorCode);

                    Log.e("TRANS", "code:" + code);
                    Log.e("TRANS", "lastErrorCode:" + lastErrorCode);


                }catch (Exception e){
                    e.printStackTrace();
                }
            }else if(cardtype == CardType.RF_CARD){
                byte code = intent.getByteExtra("ui_code",(byte)0x00);
                byte status = intent.getByteExtra("errCode",(byte)0x00);
                LogUtil.se(getClass(), "code:"+code);
                LogUtil.se(getClass(), "status:"+status);

                Log.e("TRANS", "code:" + code);
                Log.e("TRANS", "status:" + status);
            }
        }

        try {
            ServiceManager.getInstence().getPboc().stopTransfer();
        }catch (Exception e){
            e.printStackTrace();
        }
    }

int ledPin = 13;				//Pins
int buttonPin = 2;
	
bool light = true;				// latch signal
bool lastState = false;			// support var 
								// bool pressed used as pulse signal only after first if in loop.
								// (before if use like toggle signal)



void setup() {
  pinMode(ledPin, OUTPUT);		// just pin mode for led
  pinMode(buttonPin, INPUT);	// for button, nothing special
}

void loop() {
  bool pressed = digitalRead(buttonPin);
  if (pressed != lastState){				// This If is needed to make an impulse from a toggled button(only pressing)
    lastState = pressed;
  }else if(pressed == lastState && pressed == false){               
    pressed = false;
  }else if(pressed = false){
    lastState = pressed;
  }
  
  

  if(pressed == true)
  {
    light = !light;							//just latch 
  }
  delay(1);									//do you really wanna burn your Arduino? ;-)
}
